import React from "react";

let Header = () =>{
    return(
        <header>
        <nav className="flex">
          <img src={require("./src/components/images react.png")} alt="pic1"/>
          <ul className="nostyle">
            <li>Service</li>
            <li>Offer</li>
            <li>Enjoy</li>
          </ul>
        </nav>
      </header>
    )
}
export default Headser
